import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class='answer'>
    <form>
    <label>
      Question:
      <input type="text" name="name" size='100' heigh='100'/>
      <input type="submit" value="Submit" />
    </label>
    </form>
    </div>
  );
}

export default App;
